import React from 'react';
//import logo from './logo.svg';
import './App.css';
import * as Avion from './AvionPuerta';

interface IState{
  puerta:Avion.Puerta;
}

class App extends React.Component <{},IState>{
  constructor(props:any){
    super(props);
    this.state={
      puerta:new Avion.Puerta(),
    }


  }

  render(){
    var op:String[];
    op=["cerrar","Abrir","armar","Desarmar"];
    var estado:String="mamerto";
    return (<div>
      <div>
      {op.map(element => {
        return(<button>
          {element}
        </button> )
      })}
      </div>
      <div>
        {estado}
      </div>
    </div>)
  }
}




export default App;
